In this example, basic input validation is implemented with GraphQL types. Strings are used to identify the problematic field name. Errors for a particular field are also returned as a string. In this example the string contains a server-side localized error message. However, it is also possible to return a unique string identifier and have the client present a localized string to the user. # extern crate juniper;
# use juniper::{graphql_object, GraphQLObject, GraphQLUnion};
#
#[derive(GraphQLObject)]
pub struct Item { name: String, quantity: i32,
} #[derive(GraphQLObject)]
pub struct ValidationError { field: String, message: String,
} #[derive(GraphQLObject)]
pub struct ValidationErrors { errors: Vec<ValidationError>,
} #[derive(GraphQLUnion)]
pub enum GraphQLResult { Ok(Item), Err(ValidationErrors),
} pub struct Mutation; #[graphql_object]
impl Mutation { fn addItem(&self, name: String, quantity: i32) -> GraphQLResult { let mut errors = Vec::new(); if !(10 <= name.len() && name.len() <= 100) { errors.push(ValidationError { field: "name".to_string(), message: "between 10 and 100".to_string() }); } if !(1 <= quantity && quantity <= 10) { errors.push(ValidationError { field: "quantity".to_string(), message: "between 1 and 10".to_string() }); } if errors.is_empty() { GraphQLResult::Ok(Item { name, quantity }) } else { GraphQLResult::Err(ValidationErrors { errors }) } }
}
#
# fn main() {} Each function may have a different return type and depending on the input parameters a new result type is required. For example, adding a user requires a new result type which contains the variant Ok(User) instead of Ok(Item). The client can send a mutation request and handle the resulting errors as shown in the following example: { mutation { addItem(name: "", quantity: 0) { ... on Item { name } ... on ValidationErrors { errors { field message } } } }
} A useful side effect of this approach is to have partially successful queries or mutations. If one resolver fails, the results of the successful resolvers are not discarded.

