Our examples so far have only included non-critical errors. Providing errors inside the GraphQL schema still allows you to return unexpected critical errors when they occur. In the following example, a theoretical database could fail and would generate errors. Since it is not common for the database to fail, the corresponding error is returned as a critical error: # extern crate juniper;
#
