pub struct Item { name: String, quantity: i32,
} #[derive(GraphQLObject)]
pub struct ValidationErrorItem { name: Option<String>, quantity: Option<String>,
} #[derive(GraphQLUnion)]
pub enum GraphQLResult { Ok(Item), Err(ValidationErrorItem),
} pub enum ApiError { Database,
} impl<S: ScalarValue> juniper::IntoFieldError<S> for ApiError { fn into_field_error(self) -> FieldError<S> { match self { ApiError::Database => FieldError::new( "Internal database error", graphql_value!({ "type": "DATABASE" }), ), } }
} pub struct Mutation; #[graphql_object]
